(298, '0305', '风味红茶奶盖', 'Upload/goods/2016-10/58116544a9e70.jpg', 'Upload/goods/2016-10/58116544a9e70_thumb.jpg', 0, 1, 26.00, 22.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 11, 1, 2, '暖心的红茶加上一层丝滑可口的奶盖，让你在寒冷的冬天不再孤单。', 0, 0, 0, 0, 1, '2016-11-05 14:18:19', 0, '', 1, NULL, '2016-10-27 10:24:06'),
(299, 'test', 'test', 'Upload/goods/2016-10/5811663f2a073.jpeg', 'Upload/goods/2016-10/5811663f2a073_thumb.jpeg', 0, 1, 0.01, 0.01, 0, 0, 0, 0, 0, '1', 'test', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, 'test', 0, 0, 0, 0, 1, '2016-10-27 10:28:16', 0, 'test', -1, NULL, '2016-10-27 10:28:16'),
(300, '0306', '风味绿茶奶盖', 'Upload/goods/2016-10/5811663be09c6.jpg', 'Upload/goods/2016-10/5811663be09c6_thumb.jpg', 0, 1, 26.00, 22.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 11, 1, 2, '香浓绿茶与丝滑奶盖的碰撞，口感无与伦比回味无穷。', 0, 0, 0, 0, 1, '2016-11-05 14:17:56', 0, '', 1, NULL, '2016-10-27 10:29:39'),
(301, '0501', '蜂蜜柠檬茶', 'Upload/goods/2016-10/58130dc6ac3ac.jpg', 'Upload/goods/2016-10/58130dc6ac3ac_thumb.jpg', 0, 1, 20.00, 18.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 12, 1, 2, '酸酸甜甜的，加上茶香的味道', 0, 0, 0, 0, 1, '2016-11-05 14:20:35', 0, '', 1, NULL, '2016-10-28 16:36:12'),
(302, '0502', '金橘柠檬', 'Upload/goods/2016-10/58130fbcdcb4d.jpeg', 'Upload/goods/2016-10/58130fbcdcb4d_thumb.jpeg', 0, 1, 24.00, 22.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '酸甜可口，入口奇妙无比', 0, 0, 0, 0, 1, '2016-10-28 16:44:15', 0, '', 1, NULL, '2016-10-28 16:44:15'),
(303, '0504', '红豆抹茶冰沙', 'Upload/goods/2016-10/5813104f687ab.jpg', 'Upload/goods/2016-10/5813104f687ab_thumb.jpg', 0, 1, 28.00, 24.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '浓浓的奶沫，香甜红豆粒，加上清醇的抹茶，整杯饮品就是一场美妙的邂逅', 0, 0, 0, 0, 1, '2016-10-28 16:47:31', 0, '', 1, NULL, '2016-10-28 16:47:31'),
(304, '0505', '心晴', 'Upload/goods/2016-10/5813121fbbe48.jpg', 'Upload/goods/2016-10/5813121fbbe48_thumb.jpg', 0, 1, 28.00, 24.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '柠檬清香加上玫瑰的诱人花香，不由让整个人心晴愉悦、晴朗起来', 0, 0, 0, 0, 1, '2016-10-28 16:55:30', 0, '', 1, NULL, '2016-10-28 16:55:30'),
(305, '0506', '初恋', 'Upload/goods/2016-10/581313150c95b.jpg', 'Upload/goods/2016-10/581313150c95b_thumb.jpg', 0, 1, 30.00, 26.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '口感甜甜的绵绵的，丝滑丝滑，玫瑰花香与鲜奶的相撞,好似产生了一种初恋的感觉。', 0, 0, 0, 0, 1, '2016-10-28 16:59:21', 0, '', 1, NULL, '2016-10-28 16:59:21'),
(306, '0507', '冰荷世纪', 'Upload/goods/2016-10/581313ceefcaf.jpg', 'Upload/goods/2016-10/581313ceefcaf_thumb.jpg', 0, 1, 30.00, 26.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '一种可以吞的牙膏，入口清凉无比。', 0, 0, 0, 0, 1, '2016-10-28 17:01:47', 0, '', 1, NULL, '2016-10-28 17:01:47'),
(307, '1222', '12221', 'Upload/goods/2016-11/5817f888468b8.jpg', 'Upload/goods/2016-11/5817f888468b8_thumb.jpg', 0, 1, 12.00, 12.00, 0, 0, 0, 0, 0, '2121', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '212121', 0, 0, 0, 0, 1, '2016-11-01 10:06:21', 0, '', -1, NULL, '2016-11-01 10:06:21'),
(308, '0.01', '0.01', 'Upload/goods/2016-11/58195225d4dc7.jpeg', 'Upload/goods/2016-11/58195225d4dc7_thumb.jpeg', 0, 1, 0.01, 0.01, 97, 0, 0, 0, 0, '0.01', '0.01', 0, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '0.01', 0, 0, 0, 0, 1, '2016-11-02 10:40:39', 0, '0.01', 1, NULL, '2016-11-02 10:40:39'),
(276, '0101', 'Espresso', 'Upload/goods/2016-10/581160e6468f9.jpg', 'Upload/goods/2016-10/581160e6468f9_thumb.jpg', 0, 1, 16.00, 12.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;浓缩咖啡（Espresso）或意式浓缩咖啡，是一种口感强烈的咖啡类型，方法是以90.5摄氏度的热水，借由130PSI高压冲过研磨成很细的咖啡粉末来冲出咖啡。&lt;/span&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;借由短时间而高压冲煮过程，使得一杯咖啡特有的风味经浓缩后，表现的较其他冲煮器材来为强烈&lt;/span&gt;', 0, 0, 0, 0, 1, '2016-10-27 10:05:28', 0, '', 1, NULL, '2016-10-22 16:14:16'),
(277, '0102', '美式咖啡', 'Upload/goods/2016-10/5810856763ef8.jpg', 'Upload/goods/2016-10/5810856763ef8_thumb.jpg', 0, 1, 24.00, 22.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;“美式咖啡”（英文：Americano，意大利语：Caffè Americano）&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/subview/5312/7594286.htm&quot;&gt;咖啡&lt;/a&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;的一种，是最普通的咖啡。是使用滴滤式咖啡壶所制作出的&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/subview/281446/12465653.htm&quot;&gt;黑咖啡&lt;/a&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;，又或者是意式浓缩中加入大量的水制成。口味比较淡。因为一般的萃取时间相对较长（大概四五分钟），所以咖啡因含量较高。&lt;/span&gt;', 0, 0, 0, 0, 1, '2016-10-26 18:28:57', 0, '', 1, NULL, '2016-10-22 16:25:22'),
(278, '0103', '卡布奇诺', 'Upload/goods/2016-10/5810855571a93.jpeg', 'Upload/goods/2016-10/5810855571a93_thumb.jpeg', 0, 1, 28.00, 22.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/subview/8180/9216897.htm&quot;&gt;卡布奇诺&lt;/a&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;是一种加入以同量的意大利特浓咖啡和蒸汽泡沫牛奶相混合的意大利咖啡。此时咖啡的颜色，就像卡布奇诺教会的修士在深褐色的外衣上覆上一条头巾一样，咖啡因此得名。传统的卡布奇诺咖啡是三分之一浓缩咖啡，三分之一蒸汽牛奶和三分之一泡沫牛奶，并在上面撒上小颗粒的肉桂粉末。&lt;/span&gt;', 0, 0, 0, 0, 1, '2016-10-26 18:28:40', 0, '', 1, NULL, '2016-10-22 16:30:01'),
(279, '0104', '摩卡奇诺', 'Upload/goods/2016-10/58108468b09b5.jpg', 'Upload/goods/2016-10/58108468b09b5_thumb.jpg', 0, 1, 28.00, 24.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;摩卡奇诺一词广泛用于欧洲及中东部分地区，指加了可可粉或巧克力的拿铁（Latte）咖啡，或说卡布奇诺（cappuccino）加巧克力 。&lt;/span&gt;', 0, 0, 0, 0, 1, '2016-10-26 18:24:42', 0, '', 1, NULL, '2016-10-22 16:36:38'),
(280, '0105', '焦糖玛奇朵', 'Upload/goods/2016-10/58108430ddfdc.jpg', 'Upload/goods/2016-10/58108430ddfdc_thumb.jpg', 0, 1, 28.00, 24.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;焦糖玛奇朵（英文：Caramel Macchiato）是在香浓热牛奶上加入浓缩咖啡、&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/68881.htm&quot;&gt;香草&lt;/a&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;，再淋上纯正&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/subview/864149/5071236.htm&quot;&gt;焦糖&lt;/a&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;而制成的饮品，融合三种不同口味。Macchiato意大利文，意思是“烙印”和“印染”，中文音译“玛奇朵”。“Caramel”意思是焦糖。焦糖玛琪朵，寓意“甜蜜的印记”。&lt;/span&gt;', 0, 0, 0, 0, 1, '2016-10-26 18:23:51', 0, '', 1, NULL, '2016-10-22 16:40:04'),
(281, '0106', '拿铁', 'Upload/goods/2016-10/58108408a0196.jpg', 'Upload/goods/2016-10/58108408a0196_thumb.jpg', 0, 1, 28.00, 24.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;div class=&quot;lemma-summary&quot; style=&quot;font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;div class=&quot;para&quot;&gt;\n		&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/58304.htm&quot;&gt;拿铁咖啡&lt;/a&gt;是&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/1174273.htm&quot;&gt;意大利浓缩咖啡&lt;/a&gt;(Espresso)与&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/subview/4964/7517011.htm&quot;&gt;牛奶&lt;/a&gt;的经典混合，意大利人也很喜欢把拿铁作为早餐的饮料。意大利人早晨的厨房里，照得到阳光的炉子上通常会同时煮着咖啡和牛奶。喝拿铁的意大利人，与其说他们喜欢意大利浓缩咖啡，不如说他们喜欢牛奶，也只有espresso才能给普普通通的牛奶带来让人难以忘怀的味道\n	&lt;/div&gt;\n&lt;/div&gt;', 0, 0, 0, 0, 1, '2016-10-30 19:02:45', 0, '', 1, NULL, '2016-10-22 16:44:02'),
(282, '0107', '风味拿铁', 'Upload/goods/2016-10/581083f465402.jpg', 'Upload/goods/2016-10/581083f465402_thumb.jpg', 0, 1, 30.00, 24.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '在拿铁咖啡的基础上加入不同的味道，使得这杯拿铁口味更加美味丰富！', 0, 0, 0, 0, 1, '2016-10-26 18:24:20', 0, '香草，玫瑰，榛果，白巧克力', 1, NULL, '2016-10-22 16:50:48'),
(283, '0201', '哥斯达黎加', 'Upload/goods/2016-10/581083b028623.jpg', 'Upload/goods/2016-10/581083b028623_thumb.jpg', 0, 1, 36.00, 30.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;哥斯达黎加咖啡产于中美洲南部的哥斯达黎加共和国（The Republic of Costa Rica)，其咖啡品质近似&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/subview/423165/423165.htm&quot;&gt;哥伦比亚咖啡&lt;/a&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;，适宜用于调配&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/664785.htm&quot;&gt;综合咖啡&lt;/a&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;哥斯达黎加咖啡颗粒饱满、酸度理想、香味独特浓烈。&lt;/span&gt;', 0, 0, 0, 0, 1, '2016-10-26 18:21:39', 0, '', 1, NULL, '2016-10-22 17:06:44'),
(284, '0202', '曼特宁', 'Upload/goods/2016-10/58108396871d8.jpg', 'Upload/goods/2016-10/58108396871d8_thumb.jpg', 0, 1, 36.00, 30.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;div class=&quot;lemma-summary&quot; style=&quot;font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;div class=&quot;para&quot;&gt;\n		曼特宁咖啡：曼特宁&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/subview/5312/7594286.htm&quot;&gt;咖啡&lt;/a&gt;产于亚洲印度尼西亚的苏门答腊，别称“苏门答腊咖啡”。她风味非常浓郁，香、苦、醇厚，带有少许的甜味。一般咖啡的爱好者大都单品饮用，但也是调配&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/157479.htm&quot;&gt;混合咖啡&lt;/a&gt;不可或缺的品种。\n	&lt;/div&gt;\n&lt;/div&gt;\n&lt;div class=&quot;basic-info cmn-clearfix&quot; style=&quot;margin:20px 0px 35px;color:#333333;font-family:arial, 宋体, sans-serif;background:url(&amp;quot;&quot;&gt;\n&lt;/div&gt;', 0, 0, 0, 0, 1, '2016-10-26 18:21:15', 0, '', 1, NULL, '2016-10-22 17:09:32'),
(285, '0203', '耶加雪菲', 'Upload/goods/2016-10/58116584eeabf.jpg', 'Upload/goods/2016-10/58116584eeabf_thumb.jpg', 0, 1, 36.00, 30.00, 999, 0, 0, 0, 0, '杯', '', 1, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;埃塞俄比亚的耶加雪菲（Yirgacheffe ）咖啡虽身形娇小，却是温婉秀气，甜美可人。作为咖啡的故乡，埃塞俄比亚上千年的种植历史和加工传统造就了优质的水洗阿拉比卡豆。浅度烘焙有着独特的柠檬、花香和蜂蜜般的甜香气，柔和的果酸及柑橘味，口感清新明亮。不加奶也不加糖，就让丰厚的质感与独特的柔软花香刷过你的味蕾，留下无穷回味……&lt;/span&gt;', 0, 0, 0, 0, 1, '2016-10-27 10:25:10', 0, '', 1, NULL, '2016-10-22 17:12:49'),
(286, '0204', '哥伦比亚', 'Upload/goods/2016-10/580b2e60d68b9.jpg', 'Upload/goods/2016-10/580b2e60d68b9_thumb.jpg', 0, 1, 36.00, 30.00, 999, 0, 0, 0, 0, '杯', '', 0, 1, 1, 1, 1, 0, 0, NULL, 1, 9, 10, 1, 2, '&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;哥伦比亚咖啡散发着淡淡而优雅的香味，不像巴西咖啡那么浓烈，不像非洲咖啡带着酸意，而是一股甘甜的淡香，低调而优雅。&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/1341273.htm&quot;&gt;烘焙&lt;/a&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;后的咖啡豆会释放出甘甜的香味，具有酸中带甘、苦味中平的良质特性，因为浓度合宜的缘故，常被应用于高级的&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/157479.htm&quot;&gt;混合咖啡&lt;/a&gt;&lt;span style=&quot;color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;&quot;&gt;中。&lt;/span&gt;&lt;/span&gt;', 0, 0, 0, 0, 1, '2016-10-22 17:16:20', 0, '', -1, NULL, '2016-10-22 17:16:20'),
